INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (138, 49, 'My Goals', 'My Goals', 'My long-term vision of success is to build the Revel Analytics Community into a brand that is talked about when we''re not in the room amongst the CMOs and CIOs of the Greater Seattle Area. I want to build our practice into a community of the highest performing, most fun data integrators, visualizers, and data scientists, all coming together to discover new insights, tell amazing stories, and inspire and lead our clients through their digital business transformations.', 1);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (139, 49, 'My Wins', 'My Wins', 'The best is yet to come.', 1);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (140, 49, 'My Losses', 'My Losses', 'I almost died climbing Denali, and I saw people pass away around me. It still haunts me. I didn''t make the summit by about 1000ft, and to this day I still dream about it at least every few weeks. Denali taught me that I have limits, and that I am mortal. Failure teaches us more than success, if we let it.', 1);
