INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (170, 50, 'My Goals', 'My Goals', 'Continue to learn and build skills. I first strenthened vertically in Finance, and now focusing on breadth of skills horizontally. I still have a strong interest in Finance and Analytics. ', 1);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (171, 50, 'My Wins', 'My Wins', 'Lengthy career in Finance and Accounting at Starbucks and Nintendo. At Nintendo, I was heavily involved in the Oracle ERP implementation, and helped with business expansion in Latin America. At Starbucks, a proud win was revamping the corporate planning model from 40-tab workbook to a dynamic model driven by well structured pivot tables. ', 1);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (172, 50, 'My Losses', 'My Losses', 'I left Nintendo to help family with investment research/trading with longer term goal of starting a hedge fund, but it did not work out but I still learned a ton of investment strategy and analytical methods that I still use to manage my own finances.', 1);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (173, 50, 'My Personal Brand', 'My Personal Brand', 'I have strong experience in Finance and Cost Accounting, which has made me strong in data analysis, critical thinking, and process improvement. I worked with my cross-functional teams and have a great get-along factor. I am a data junkie and an early adopter of new technology.', 1);
