INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (330, 55, 'My Goals', 'My Goals', 'I want to be consistently challenged by anything I''m involved in. It''s difficult for me to be stagnant in a career and for this reason, I''ve always tried to rely on my technique while expanding on those things I''m already comfortable with. I''d like to be someone others can look to and be comfortable with coming to for leadership and direction, in addition to any technical expertise I may possess. I see myself becoming a big picture guy when it comes to mapping out project architecture and solutions. This is mostly encouraged by my appreciation for strong and positive collaboration between all of those involved in whatever the final solution may be.', 1);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (331, 55, 'My Wins', 'My Wins', 'I am very proud of the fact that I feel that my life has gotten better with every year. While there have been setbacks and no small number of tragedies, I always seem to pick myself up and make myself better in some way, whether it''s something tangible, like learning some new skill, or intangible, like figuring out how to better who I am on the inside and my mental state.', 1);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (332, 55, 'My Losses', 'My Losses', 'I''ll keep this strictly work related. Early on I went after a masters in computer science, but didnï¿½t get accepted based on my work experience. I''m going to try this again now that I''ve got a little more work under my belt.', 1);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (333, 55, 'My Personal Brand', 'My Personal Brand', 'I get things done while helping others to feel invested in the process. I am ok with making the decisions that need to be made, and owning the mistakes and successes that result from those decisions.', 1);
