INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (554, 62, 'My Goals', 'My Goals', 'Managing a team of individuals who I can inspire through my actions i.e. lead by example. A coach and mentor who fosters team and individual growth. The person at a company where they come to in order to: 1) get things done and 2) collaborate on strategic inititives / opporutnities. I want to grow in my development in 1) Corporate finances, 2) Digital marketing and sales tools, and maybe get back into learning a programming language', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (555, 62, 'My Wins', 'My Wins', 'Provided a POV / roadmap for PI to transform their PMO to a Solution Delivery model which will better align to their strategic initiatives and improve operational efficiencies which is essential in a lean staff operating model. Also, a revenue opportunity for Revel.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (556, 62, 'My Losses', 'My Losses', 'Pitched the idea of transforming the PMO. However, not sure if PI is ready to invest in the change and believe if transorming the PMO is really necessary. Just staffing project managers and managing projects appears to be good enough.', 2);
