INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (586, 63, 'My Goals', 'My Goals', 'My personal goal is to become a specialist in a particular area or field, so that my expertise would be sought out and appreciated.  For instance, a lot of my time has been spent at Microsoft, particularly in areas of licensing and pricing.  If further projects help expand my knowledge on licensing so that I would be considered a valuable resource (not only at Microsoft, but at other companies that have similar policies and structures), then I would consider that a successful career direction.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (587, 63, 'My Wins', 'My Wins', 'I am most proud of the work I did on the FY17 wrap-up for the Workforce Planning division at Microsoft.  It was with this nearly month-long project that I was able to demonstrate my mastery of the procedures and VERY intricate worksheets that comprised an overall report of the year-long utilization results.  This was particularly satisfying for me because this contract has begun in late January with not much time given for ramp-up.  To be able to confidently navigate through the various files to derive the needed results was extremely satisfying for me. ', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (588, 63, 'My Losses', 'My Losses', 'Unfortunately, the Workforce Planning division at Microsoft was restructured for FY18, with some roles transferring to a division in India and others eliminated.  During this tumultuous time, my monthly reporting, which included detailed PowerPoint presentations, seemed to fall through the cracks and was not distributed out.  This was disheartening because I thought the information would be invaluable to a lot of people.  ', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (589, 63, 'My Personal Brand', 'My Personal Brand', 'A personable hard worker that can be trusted to give a fresh perspective while staying within guidelines, and over-deliver on the qualitative results.', 2);
