INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (650, 65, 'My Goals', 'My Goals', 'Success for me is achieving happiness in and out of work.  The goal for me is to get up every day and feel like work is not work.  Truly and passionately enjoy what I do. ', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (651, 65, 'My Wins', 'My Wins', 'Closing out another fiscal year end at Microsoft.  Keeping control of the crazy for another year.   On a personal level catching two King Salmon was a highlight for me.  Spent many hours researching where to go, what to use and it finally happened. ', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (652, 65, 'My Losses', 'My Losses', 'No real losses from a professional stand point.  On a personal level my hockey team has lost our last 3 games, it''s combination of new players and gelling together. ', 2);
