INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (682, 66, 'My Goals', 'My Goals', 'I enjoy managing teams/projects and developing people.  I''d like to use my skillset to add value to both people and organizations.  I am most successful when I am supported, but allowed to land my own projects and manage my own work/client.  ', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (683, 66, 'My Wins', 'My Wins', 'Moving into FY18 at Microsoft, I was able to renew my contract as well as bring on 2 additional Revel resources to help improve my client''s team.  All of our projects are working together to help my client mature his organization operationally, but we''re also building momentum to help him achieve value in the spirit of the "Monetizing Trust" megatrend.  I''m proud of setting up a network of projects that are win-win-win scenarios (creating value for the client, Revel, and Revel associates / MS team members).', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (684, 66, 'My Losses', 'My Losses', 'My client recently went out on Paternity Leave and, in retrospect, this summer may not have been the best time to launch all of the change projects that we''ve set up on his team.  The combination of summer OOF schedules, recent manager departures, and my client being out for Paternity Leave have made driving progress forward on some workstreams challenging.  We''ve adapted plans / expectations and have been continuing to drive progress forward, but there are definitely pockets of change fatigue on the team.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (685, 66, 'My Personal Brand', 'My Personal Brand', 'Feedback on my top strengths over the course of my career from clients, managers, peers, and direct reports has been consistent.  I''m reliable and I deliver, with no oversight/follow-up needed.
