INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (714, 67, 'My Goals', 'My Goals', 'My long-term vision is to become a CEO of my own company. I recently came off a project and now on the bench. I have been teaching myself a lot of sql and IOS development. Within the last couple of weeks, I have been able to create over 10 different apps for an iPhone. I have a couple of business plans and goals for my 5 and 10 year road plan but the long-term vision is to become my own boss of a technological company.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (715, 67, 'My Wins', 'My Wins', 'I have created a strategy plan to host a huge soccer tournament in Seattle. I executed that plan by getting sponsorships for over $150k, title sponsor was uber ($100k), it took over 4 months to plan and execute but at the end, the tournament brought over $520,000 just only from the entrance. We had the mayor, senator and other prominant leaders attend the tournament as well. ', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (716, 67, 'My Losses', 'My Losses', 'The fact that I was on the bench for over a month and half and not finding a role was my loss because I don''t get paid when I am on the bench.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (717, 67, 'My Personal Brand', 'My Personal Brand', 'I want to be the best person that I can possibly be to myself and my community. I am open and take constructive feedbacks and work to better myself. I am a quick learner that strives to be on top of the current technology and continue learning new things.', 2);
