INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (746, 68, 'My Goals', 'My Goals', 'In the next 5 years, I want to become a strong product manager. I hope to gain experience in human centered design and engineering. This will allow me to leverage my expertise in finance, business strategy, marketing, and cross-functional leadership to be a well rounded product lead capable of defining vision for a product and executing on its success in the market. I want to emphasize an equity lens in my work, spending my time working on projects that make our world more equitable and well as learning how to push organizations toward equity across multiple dimensions, particularly gender and race. ', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (747, 68, 'My Wins', 'My Wins', 'In the last couple months, I delivered the thinking for two high profile deliverables at Microsoft. First, I developed an analysis of Amazon''s push into productivity and the resultant threat for Office and Microsoft more broadly. That thinking is going into a whitepaper that will go to from my client, the Office strategy team, to the Microsoft SLT as well as into a single slide that will go into a company wide compete report published by the corp strat team. Second, I wrote a whitepaper that outlined a potential large new growth vector for the Office & LinkedIn business, and was tapped to insert that thinking into a whitepaper for Office and LinkedIn leadership on potential "big bets". ', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (748, 68, 'My Losses', 'My Losses', 'Our team was asked to support product marketing and engineering as they thought through strategic positioning and roadmap for a new Microsoft product. We delivered an initial competitive landscape of the space with key insights that they could take back to their business, and were asked to go deeper on several key questions. The plan was to work with product marketing to deliver an analysis to the engineering team, but while we delivered our piece of the work, PMM went dark. In retrospect, the work was a bit out of scope for our team anyway, and we should have pushed back on spending the cycles to deliver the project. We also could have leveraged engineering more to ensure that PMM was remaining engaged. ', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (749, 68, 'My Personal Brand', 'My Personal Brand', 'I have built my career on connecting communities to create opportunity for people who have been marginalized. I have one foot firmly in the corporate and tech world, and am skilled in strategy, finance, and marketing, and the other foot firmly in a commitment to work for equity and justice in our community and world. This approach has led me to experiences that position me uniquely as a business thinker with an equity lens, with deep experience in the tech industry. My value is in leveraging a corporate strategy mindset to develop innovative solutions for social problems, and in connecting the grasstops to the grassroots to support existing efforts. ', 2);
