INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1290, 85, 'My Goals', 'My Goals', 'I want to continue to hone my expertise while challenging myself to learn new skills. My long-term vision of success is to consistently help my clients solve their toughest business problems.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1291, 85, 'My Wins', 'My Wins', 'Planning and executing T-Mobile''s first Salesforce.com rollout within Digital Frontline, which was the first step at achieving an omnichannel experience across tele/retail/web. This was part of the execution of the omni/lead gen strategy I created earlier in the year.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1292, 85, 'My Losses', 'My Losses', 'I tried to wrap up the network-wide Salesforce rollout plans prior to my departure, but due to multiple stakeholder OOOs, I was unable to finalize this. ', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1293, 85, 'My Personal Brand', 'My Personal Brand', 'People like working with me and I work hard to protect that personal brand. By "like" I don''t mean they always find me affable - I mean that I challenge and question the status quo, roll smoothly when things are ambiguous, and flex and work hard to get results and make my clients successful. All with a great attitude and a smile. ', 2);
