INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1322, 86, 'My Goals', 'My Goals', 'Replicating skills that differentiate me as a consutant across as many Revelrs as possible. I can''t do anything alone as well as we can do it together.  I learn form others and want to share my expertise with anyone who may benefit.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1323, 86, 'My Wins', 'My Wins', 'Made the turn from one release to another with no break, while evolving the release planning methodology and tools to incorporate lessons learned.  And it happened during the year-end renewal process, and I was on vacation for 2 1/2 weeks.  And it seems to have stuck.  Yeah, that feels pretty good.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1324, 86, 'My Losses', 'My Losses', 'I consistently fail to show instead of tell.  So often I use my words to articulate a solution, talking AT people instead of talking TO and co-creating with them.  Showing allows others to put their hands on it, add/morph thje idea, make it their own, and help tak it out to the world.  I need to do more of that.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1325, 86, 'My Personal Brand', 'My Personal Brand', 'Context. Transparency. I try to provide asnecdotes from my own career journey to help people make the best possible decision for themselves and family.  ', 2);
