INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1450, 90, 'My Goals', 'My Goals', 'My long-term vision would for me to ideally be able to provide top-level support to any client on any project leveraging my prior experience and my abilities to ensure their needs are met in a timely fashion.
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1451, 90, 'My Wins', 'My Wins', 'In my current project, we are supporting the expansion of a Service Center functionality to a global audience. The current customer has a unique skillset that can assist our Sales teams to create polished high-quality proposals to customers in order to increase sales. We have been able to lay groundwork for those expansion plans and start impelmenting changes to bring the team to scale and grow headcount by a multiple of 3x-4x.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1452, 90, 'My Losses', 'My Losses', 'I wish I had more time to align my clientâs long-term strategic goals and with what I can bring to the table. This project has been spinning quickly and we have not taken the time to plan out a strategy', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1453, 90, 'My Personal Brand', 'My Personal Brand', 'I can bring a broad skillset with a wide range of experience to any project/client. While my degree was in Finance and Information Systems, the projects I have been associated with at Revel include process engineering, project/program management, and implementation, which I believe lead me to be a well-rounded consultant, suited for any project/problem.', 2);
