INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1610, 95, 'My Goals', 'My Goals', 'I want to be working in product management working on digital products people buy.  I''m working in Digital Services for T-Mobile as a Senior Product Manager for their app and website.  I enjoy a lot of aspects of the role, but the product I''m working is a platform to purchase other products (phone service and devices) and account management.  In the future, my preference would be to work on the actual software that customers are paying for.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1611, 95, 'My Wins', 'My Wins', 'Designing and delvering the customer experience (web) for T-Mobile''s next Uncarrier move and rate plan.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1612, 95, 'My Losses', 'My Losses', 'Getting my client to balance out my workload with the three projects that I''m driving for T-Mobile Digital Services now.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1613, 95, 'My Personal Brand', 'My Personal Brand', 'I deliver high quality digital customer experiences by synthesizing data, usability research, UX feedback and developer input.', 2);
