INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1642, 96, 'My Goals', 'My Goals', 'I just want to grow, period. I want to learn, I''m not too specific on what I want to learn, but I''m always interested in learning new things', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1643, 96, 'My Wins', 'My Wins', 'I learned PWA (had only previously used Project Pro) to the extent that I became known as the expert on the product. I was the go to resource for all support asks from the field.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1644, 96, 'My Losses', 'My Losses', 'I attempted to move a piece of work from my project that wasn''t in Revel''s control, under Revel''s control. They agreed that it would have been better than their current situation but would be too difficult to move control that far into the work.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1645, 96, 'My Personal Brand', 'My Personal Brand', 'I pride myself on my ability to ramp up quickly. I am constantly able to join a project and learn the required skills and ramp up quicker than most people. I have a unique ability to break things down in my head such that it allows me to pick up on the important details quicker than most and then I can move on to understanding the bigger picture after I''m mobilized', 2);
