INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1674, 97, 'My Goals', 'My Goals', 'I aim to have enough sme knowledge to train and develop  associates in the manner in which I was trained and provided an opporutnity.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1675, 97, 'My Wins', 'My Wins', 'over the past 2 months our executive sponsor has come to me directly for my skill and expertise in crafting his executive message (reaching out directly to me via phone and text). Having earned his trust and confidence, I was asked to prepare a message for the CEO to deliver as well. I was able to craft these presentations without much guidance and the client was extremely pleased that very few revisions were needed.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1676, 97, 'My Losses', 'My Losses', 'I attempted to issue a weekly report to our managing director that would keep him updated on the overall activities and plans of the engagement. The format and methods for gathering information across the team proved unsustainable as I was responsible for the full message.  Having learned this, I am moving to a dashboard view that will be issued every other week, where the team will be responsible for updating thier various sections of thier project in the template and format I''ve provided, in addition to their travel plans.', 2);
INSERT INTO human_element_survey (id, emp_id, category, dimension, value, community_id) VALUES (1677, 97, 'My Personal Brand', 'My Personal Brand', 'Agile, composed in abiguous situations and under extreme pressure, empathetic and witty in the face of conflict, and continuously striving for best outcomes ', 2);
